18	Parabéns, você trouxe nossa empresa até aqui. Agora estamos jogando no nível das gigantes!	0
18	Nosso próximo desafio é gerenciar parcerias estratégicas com corporações globais.	1
18	Essas empresas querem integrar seus serviços diretamente à nossa ferramenta — mas isso só vai funcionar se garantirmos segurança total e rastreabilidade.	2
18	O sistema deve permitir integrações seguras, auditorias automáticas e controle de acesso preciso.	3
18	Você precisa completar o diagrama iniciado pela equipe. Ele está incompleto e cheio de lacunas lógicas.	4
18	Identifique e conecte corretamente os atores principais: o Parceiro, o Sistema de Integração (API Gateway) e a Equipe de Segurança e Compliance.	5
18	Há processos essenciais a serem representados: acesso, autenticação, sincronização de repositórios, auditoria e revogação de permissões.	6
18	Lembre-se: cada integração precisa ser auditável. Um erro aqui pode comprometer toda a nossa reputação no mercado corporativo.	7
5	Olá, aluno! Eu sou a Professora Regiane, colega do Professor Carlos. Ele me contou que você mandou muito bem!	0
5	Agora vamos aplicar o que aprendeu em um exercício que simula um cenário do mundo real da faculdade — a lanchonete do campus.	1
5	Pense no sistema que controla os pedidos, pagamentos e preparo dos lanches.	2
5	Veja, já começamos o diagrama, mas ele está incompleto. Cabe a você finalizar as conexões e adicionar o que falta!	3
5	Quem participa? Temos Clientes, Atendentes e Cozinheiros — cada um com suas ações no sistema: Fazer Pedido, Pagar Conta, Processar Pedido e Preparar Pedido.	4
5	Conecte cada ator com as ações que ele realiza: o Cliente faz e paga o pedido, o Atendente processa, e o Cozinheiro prepara	5
5	Antes de começarmos, vou te ensinar dois conceitos muito usados: <<include>> e <<extend>>.	6
5	<<include>> indica uma ação obrigatória que sempre acontece dentro de outra.	7
5	<<extend>> indica uma ação opcional, que só ocorre em determinadas situações.	8
20	Prazer, sou o Diretor Executivo da empresa. Você deve ser o jovem talento que ajudou o RH. Bom trabalho. Mas agora é hora de pensar grande	0
20	Nosso próximo desafio é construir um ERP — Enterprise Resource Planning.	1
20	Um ERP é um sistema integrado que conecta todos os departamentos de uma empresa.	2
20	Ele organiza informações financeiras, gerencia funcionários, acompanha vendas, estoques e ajuda a tomar decisões mais rápidas e confiáveis.	3
20	Para simplificar, vamos focar em dois módulos principais: Financeiro e RH.	4
20	O módulo Financeiro vai controlar contas e gerar relatórios.	5
20	O módulo de RH vai gerenciar os funcionários e calcular os salários.	6
20	Todos os módulos serão conectados pelo Núcleo do ERP, que sincroniza os dados entre eles.	7
20	Ah, e note que os módulos Financeiro e RH são agregados ao NúcleoERP — isso quer dizer que eles funcionam de forma independente, mas o núcleo os conecta e integra.	8
20	Essa relação é chamada de agregação, representada pela seta com losângo vazio, pois o ERP reúne partes que também podem existir separadamente.	9
20	Sua tarefa é modelar classes claras, com atributos e métodos visíveis, e mostrar como os módulos se relacionam.	10
20	Se conseguir representar essa estrutura com clareza, você provará que entende o verdadeiro valor da integração empresarial.	11
18	Complete o diagrama e mostre que nossa arquitetura é tão confiável quanto inovadora.	8
24	Pânico! Nosso sistema está instável e os clientes estão reclamando.	0
24	Seu objetivo é organizar o diagrama de monitoramento de crises, mostrando como todos os atores e processos interagem para manter o sistema sob controle.	1
24	Identifique os principais participantes: o Operador de Monitoramento, o Gerente de Crises, o Sistema de Alertas e a Equipe de Suporte.	2
24	Inclua ações essenciais que refletem o fluxo completo da gestão de crises: detecção de falhas, registro de incidentes, escalonamento de problemas, envio de alertas, confirmação da resolução e geração de relatórios.	3
24	O diagrama deve refletir o ciclo completo: da identificação do problema até a análise pós-incidente, garantindo aprendizado e prevenção futura.	4
24	Cada conexão precisa estar correta — qualquer erro pode aumentar o impacto da crise.	5
21	Emergência! Estamos fundindo nossa empresa com um concorrente, e os sistemas são incompatíveis.	0
21	Identifique os atores: Sistema A, Sistema B, Equipe de TI e Gerente de Mudança.	1
21	Represente as principais ações necessárias para a integração: adaptação de dados, aplicação de regras de compatibilidade, treinamento da equipe e monitoramento da integração.	2
21	Mostre claramente quem realiza cada ação e como os processos se conectam.	3
21	O fluxo deve ser: Sistema A/B → Adaptador → Camada de Compatibilidade → Gestão de Mudança.	4
21	Se fizer isso corretamente, a fusão será bem-sucedida; caso contrário, teremos caos completo!	5
21	Trabalhe 80h/semana até resolver!	6
23	Você é o novo Engenheiro de Software, certo? Sou o Gerente de TI. Esse sistema roda há 20 anos. Ninguém sabe exatamente como funciona — e agora ele está falhando em produção.	0
23	Identificamos race conditions e memory leaks em vários módulos.	1
23	O código é legado — mais de 20 anos sem documentação. Boa sorte tentando entender.	2
23	Veja o diagrama atual: classes mal conectadas, dependências circulares, e nomes genéricos como LogOperacao e fixes que não significam nada.	3
23	A classe LogOperacao precisa evoluir: torne-a uma estrutura de Auditoria, com lista de logs e um método para monitorar operações.	4
23	A Conta precisa ser segura para threads — inclua algum mecanismo de bloqueio (lock) e um método transferirSeguro() que evite race conditions.	5
23	O PatchCritico não está modelado direito. Ele deve representar um conjunto de correções, não uma string solta.	6
23	Conecte as classes de forma lógica: Conta se relaciona com Auditoria, e Auditoria com CorreçãoEmergencial.	7
23	E lembre-se: isso precisa ir pra produção até amanhã. Sem falhas. Trabalhe 24/7 até resolver!	8
22	Parabéns! Você foi promovido a Gerente.	0
22	Sou o Presidente desta corporação. Cheguei aqui trabalhando mais do que todos, e espero o mesmo de você.	1
22	Agora terá que lidar com metas cada vez mais altas, resultados sob pressão e estresse constante.	2
