14	Olá, sou a nova CTO da ColabUML. Fui contratada depois da rodada de investimento que vocês garantiram, e estou empolgada com o potencial da nossa plataforma	0
14	Nosso próximo grande passo é transformar a ColabUML em uma ferramenta com Inteligência Artificial. Chega de diagramar manualmente — queremos que o sistema gere diagramas automaticamente a partir de texto e comportamento do usuário.	1
14	Para isso, precisamos de uma arquitetura modular. Modele o sistema com as classes certas para dar vida à nossa IA.	2
