1	Atores representam papéis, não pessoas físicas. Um mesmo usuário real pode ser vários atores no sistema.
2	O nome de um Caso de Uso é sempre um verbo no infinitivo. Ex: "Efetuar Pagamento", "Cancelar Pedido".
3	Use <<include>> para comportamento comum e obrigatório. Se uma etapa "A" sempre exige a etapa "B", use <<include>> de A para B.\n
4	Use <<extend>> para comportamento opcional que depende de uma condição. O Caso de Uso estendido pode ser executado ou não.
5	Generalização de Atores: Um ator "Cliente VIP" pode ser uma especialização do ator "Cliente", herdando seus casos de uso.
6	Generalização de Casos de Uso: "Efetuar Pagamento" pode ter especializações como "Pagar com Cartão" e "Pagar com PIX".
7	Mantenha o foco no "O Quê", não no "Como". Casos de Uso descrevem a funcionalidade, não a implementação técnica.
8	O Sistema é a fronteira. Todos os casos de uso ficam dentro de uma caixa que representa os limites do seu sistema.
9	Atores podem ser sistemas externos. Um "Gateway de Pagamento" ou "Serviço de E-mail" são atores válidos.
10	Evite sequências longas de passos no fluxo principal. Se estiver muito complexo, considere dividir em casos de uso menores.
11	Fluxos Alternativos são para "caminhos felizes" que fogem do principal. Ex: "Pagamento Aprovado" (principal) vs "Pagamento Recusado" (alternativo).
12	Pré-condição: O que deve ser verdadeiro ANTES de iniciar o caso de uso. Ex: "Usuário deve estar logado".
13	Pós-condição: O estado do sistema APÓS a conclusão bem-sucedida do caso de uso. Ex: "O pedido é marcado como 'pago'".
14	O Atores Primários iniciam a interação. Eles têm o objetivo a ser alcançado. Os Atores Secundários são acionados pelo sistema para ajudá-lo.
15	Uma Classe é composta por 3 partes: Nome, Atributos e Métodos. Sempre nessa ordem.
16	Visibilidade é crucial: + (Público), - (Privado), # (Protegido). Use para controlar o acesso.
17	Multiplicidade define o relacionamento quantitativo. Ex: 1 (exatamente um), 0..* (zero ou muitos), 1..* (um ou muitos).
18	Herança (Generalização) é para "é um". Se "Carro" é um "Veículo", faça Carro herdar de Veículo. A seta vai da subclasse para a superclasse.
19	Agregação é um "tem um" com partilha. A parte pode existir sem o todo. Ex: Um Time (todo) tem Jogadores (partes). Seta losango vazio.
20	Composição é um "tem um" forte, de posse exclusiva. A parte não existe sem o todo. Ex: Uma Casa (todo) tem Salas (partes). Seta losango cheio.
21	Associação é o relacionamento mais simples. Mostra que duas classes se conhecem e interagem. Pode ser bidirecional ou unidirecional.
22	Atributos são substantivos, Métodos são verbos. Atributo: -cor: String. Método: +acelerar(): void.
23	Interfaces são contratos. Uma classe que "realiza" uma interface (implements) deve implementar todos os seus métodos. Use o losango de realização ou a seta pontilhada.
24	Evite "Classes Deus" que fazem tudo. Divida responsabilidades em várias classes coesas. Isso é o princípio da responsabilidade única.
25	O contexto do projeto define o nível de detalhe. Em fases iniciais, mostre apenas os principais atributos e métodos. Detalhes vêm depois.
26	Você já clicou no mapa? Ele tem o formato de um diagrama de atividades.
27	Você pode adicionar um elemento clicando na caixa e depois onde deseja adicioná-lo, ou clicando nele e arrastando até onde deseja.
\.


